const { Parallax, ParallaxLayer } = require('react-spring/addons.cjs')

export class App extends React.Component {

	constructor(props) {
		super(props);
	}
	render () {
		return (
			<Parallax pages={3} scrolling={false} horizontal ref={ref => (this.parallax = ref)}>

				<ParallaxLayer offset={1} speed={1} style={{ backgroundColor: '#805E73' }} />
				<ParallaxLayer offset={2} speed={1} style={{ backgroundColor: '#87BCDE' }} />

				{/* PAGE 1 */}
				<ParallaxLayer 
					offset={0}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
					<span onClick={() => this.parallax.scrollTo(1)}>
						<img width="400em" src={'../static/placeholder.png'}/>
					</span>
				</ParallaxLayer>
				<ParallaxLayer 
					offset={1}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
					<span onClick={() => this.parallax.scrollTo(2)}>
						<img width="400em" src={'../static/placeholder.png'}/>
					</span>
				</ParallaxLayer>
				<ParallaxLayer 
					offset={2}
					speed={0.5}
					style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
					<span onClick={() => this.parallax.scrollTo(0)}>
						<img width="400em" src={'../static/placeholder.png'}/>
					</span>
				</ParallaxLayer>
			</Parallax>

			)
}
}

export default App;
